import React from "react";

const TeamMember = ({ name, major, github }) => {
  return (
    <section className="team-member">
      <div class="card">
        <h4>{name}</h4>
        <p>{major}</p>
        <a href={github}>Github Page</a>
      </div>
    </section>
  );
};

export default TeamMember;
